INSERT INTO `equipes` (`id`, `nom_equipe`, `description_equipe`, `document_path`, `created_at`, `matricule`) VALUES
(1, 'innova-Tech', 'Nous sommes une équipe dynamique  réunis pour participer à cet hackathon. Notre mission est de créer des solutions innovantes et efficaces qui répondent aux besoins du marché tout en apportant une réelle valeur ajoutée. Chacun de nous apporte ses compétences uniques, qu’il s’agisse du développement, du design ou de la gestion de projet. Ensemble, nous mettons tout en œuvre pour relever les défis, repousser les limites de la technologie et offrir des solutions créatives et fonctionnelles.', 'documents/1YPP0666_justificatif.pdf', '2025-03-14 09:38:55', '1YPP0666'),
(2, 'CodeStorm', 'Nous sommes une équipe passionnée de développeurs, designers et innovateurs réunis pour relever les défis du hackathon. Notre objectif est de concevoir un projet original, fonctionnel et impactant dans un temps limité, en combinant efficacité, collaboration et esprit d&#039;équipe.', 'documents/VYZYB8YY_justificatif.pdf', '2025-03-17 11:27:51', 'VYZYB8YY'),
(3, 'cyberSecureNet Warriors', 'SecureNet Warriors est une équipe composée d&#039;étudiants en deuxième année, passionnés par la cybersécurité . Malgré notre jeune expérience, nous sommes motivés, curieux et prêts à relever le défi de la sécurité numérique au Gabon.', 'documents/64U02LC0_justificatif.pdf', '2025-03-17 12:38:37', '64U02LC0'),
(4, 'Atlascyberpunck', 'Notre équipe est composée de six membres aux compétences complémentaires , réunissant des profils variés pour garantir une approche globale et efficace des projets que nous entreprenons :\r\n\r\nTrois développeurs spécialisés en développement logiciel, web et mobile, maîtrisant les technologies modernes pour concevoir des solutions innovantes et performantes.\r\nDeux agents réseaux experts en administration, sécurisation et optimisation des infrastructures réseau, assurant la fiabilité et la fluidité des communications.\r\nUn marketeur chargé de la stratégie marketing, de la communication et de la valorisation des projets, avec une expertise en marketing digital et en analyse de marché.', 'documents/6ZBX8B42_justificatif.pdf', '2025-03-17 14:14:48', '6ZBX8B42'),
(6, 'Zénith', 'Notre objectif, atteindre le sommet', 'documents/9GYLC1FT_justificatif.jpg', '2025-03-19 15:44:36', '9GYLC1FT'),
(7, 'TUX_FAMILY', 'TUX_FAMILY incarne la confiance, la robustesse et une cybersécurité de pointe pour un monde numérique plus sûr', 'documents/T55LTB6A_justificatif.pdf', '2025-03-19 18:35:58', 'T55LTB6A'),
(8, 'Digital ANEJ', '', 'documents/PIIXKD2W_justificatif.pdf', '2025-03-19 20:48:36', 'PIIXKD2W'),
(9, 'Ask_Secure', 'Nous des jeunes passionnés par les nouvelles technologies', 'documents/WMA71X1X_justificatif.pdf', '2025-03-19 22:26:44', 'WMA71X1X'),
(10, 'newgen', '', 'documents/PKEQM6ZM_justificatif.pdf', '2025-03-19 23:05:12', 'PKEQM6ZM'),
(11, 'Arnils', 'Expertise IT &amp; IA', 'documents/XH349JU0_justificatif.pdf', '2025-03-20 01:22:08', 'XH349JU0'),
(14, 'Ghostsec', 'Nous sommes des jeunes chercheur et très pointue sur les nouvelles technologie nous faisons juste des effet surprise', '', '2025-03-20 14:42:39', 'INPDXYQW'),
(15, 'ORENIGA', '', 'documents/WUBNL4L8_justificatif.pdf', '2025-03-20 15:03:10', 'WUBNL4L8'),
(16, 'LinkTech', 'LinTech est une équipe dynamique et innovante spécialisée dans la création des solutions technologiques qui connecte les idées les personnes et les systèmes', '', '2025-03-20 15:32:13', 'VMDIKS0Z'),
(17, 'Team Building', 'Une équipe composée des jeunes motivés dans l&#039;informatique pour apprendre un peu plus dans la cyber sécurité', '', '2025-03-20 20:42:41', 'ZF7CH4VN'),
(18, 'Zéro day', 'Le savoir est une arme', '', '2025-03-20 22:02:26', 'F9H0H4II'),
(19, 'Hackabomb', 'Tu deviens un obstacle, on t’allume', '', '2025-03-21 01:26:23', 'UBJZI92Y'),
(20, 'VICT3AM', '', '', '2025-03-21 02:46:22', 'GC7CMZFH'),
(21, 'Asfáleia', '', '', '2025-03-21 03:49:20', 'TTRL4CI4'),
(22, 'MENGUE', '', '', '2025-03-21 08:06:33', 'HHESCNAA'),
(23, 'Fly&amp;Dev', 'Fly&amp;Dev est une équipe passionnée qui allie programmation de pointe et maîtrise du pilotage de drones. Nous combinons innovation technologique et créativité pour repousser les limites du possible, que ce soit dans le développement de logiciels ou dans l&#039;exploration des airs. Que ce soit pour des projets de cartographie, de surveillance, de divertissement ou de solutions sur mesure, Fly&amp;Dev est là pour donner vie à vos idées et les faire décoller vers de nouveaux horizons.', 'documents/J2UYCW5V_justificatif.pdf', '2025-03-21 08:43:00', 'J2UYCW5V'),
(24, 'OPE SERVICES', '*Ope Services* est une entreprise innovante spécialisée dans la communication, l&#039;impression sur tous supports, ainsi que la création de solutions numériques sur mesure. Nous accompagnons nos clients dans la transformation digitale en offrant des services allant de la conception de sites web et d&#039;applications mobiles à l&#039;optimisation de leur présence en ligne. Notre mission est de fournir des solutions créatives, adaptées aux besoins spécifiques de chaque entreprise, tout en garantissant qualité, réactivité et expertise.', 'documents/RSS55H84_justificatif.pdf', '2025-03-21 10:19:32', 'RSS55H84'),
(25, 'IAI Solver', '', '', '2025-03-21 17:19:01', 'RI3ZVZ13'),
(26, 'Ope services team', '*Ope Services* est une entreprise innovante spécialisée dans la communication, l&#039;impression sur tous supports, ainsi que la création de solutions numériques sur mesure. Nous accompagnons nos clients dans la transformation digitale en offrant des services allant de la conception de sites web et d&#039;applications mobiles à l&#039;optimisation de leur présence en ligne. Notre mission est de fournir des solutions créatives, adaptées aux besoins spécifiques de chaque entreprise, tout en garantissant qualité, réactivité et expertise.', 'documents/3XQXGKI0_justificatif.pdf', '2025-03-22 09:14:29', '3XQXGKI0'),
(27, 'Génie Mass', 'Nous sommes un groupe de jeunes étudiants développeur', '', '2025-03-22 21:38:49', 'I2RNH4KK');
